import React from "react";
import firebase from "firebase";

import { dataToString } from "../../utilities.js";
import Chart from "./../../images/Group 5.png";
import DataTable from "./datatable.js";

function CalculationCell({ cell, cellID, data }) {
  return (
    <>
      Calculating the mean <br></br> <br></br>
      <DataTable data={data}/>
      <div className="calculations-chart"></div>
      <div className="calculation-type"> Calculating Mean</div>
    </>
  );
}

export default CalculationCell;
